import React, {useState, useEffect} from "react";
import Axios from "axios";
import Footer from "./Footer";
import { Link, Switch, Route, useHistory } from 'react-router-dom';
import ArrowBackIcon from '@material-ui/icons/ArrowBack';

function Lookup() {
    const history = useHistory();
    const [isMouseOver, setMouseOver] = useState(false);
    const [buttonDisplay, setButtonDisplay] = useState(false);

    function handleMouseOver() {
        setMouseOver(true);
    }

    function handleMouseOut() {
        setMouseOver(false);
    }

    function handleChange() {
        setButtonDisplay(true);
    }


    return (
    <div className="page-container">
        <h1 className="page-header">Customer Lookup</h1>
        <label className="lookup-label">License Plate Number</label>
            <input type="text" placeholder="License Plate" className="lookup-input" onChange={handleChange}/>
        <label className="lookup-label">Customer's Full Name</label>
            <input type="text" placeholder="Full Name" className="lookup-input" onChange={handleChange}/>
        <label className="lookup-label">Email Address</label>
            <input type="text" placeholder="Email Address" className="lookup-input" onChange={handleChange}/>
            {buttonDisplay === true && (
            <button
                className="lookup-input search"
                style={{backgroundColor: isMouseOver ? "black" : "#E75A25"}}
                onMouseOver={handleMouseOver}
                onMouseOut={handleMouseOut}
                onClick={() => history.push("/lookuptable")}
            >Search
            </button>
           )}
        <button
            className="back-button"
            onClick={() => history.push("/option")}>
            <ArrowBackIcon></ArrowBackIcon>
        </button>
        <Footer />
    </div>
    )
}

export default Lookup;
